import '../file/file.css'
import folder from '../../../../assets/folder.png';
import doc from '../../../../assets/doc.png';
import pdf from '../../../../assets/pdf.png';
import picture from '../../../../assets/picture.png';
import zipFile from '../../../../assets/zip-file.png';
import txtFile from '../../../../assets/file.png';
import mp3 from '../../../../assets/mp3.png'

const LoadingFile = props => {
    return (
        <div
            tabIndex={1}
            className='File-container'
        >
            <img className='File-img' style={{pointerEvents: 'none'}} src={props.files.type} alt='' />
            <span className='File-name' style={{pointerEvents: 'none'}}>{props.files.name}</span>
            <span className='File-date' style={{pointerEvents: 'none'}}></span>
            <span className='File-size' style={{pointerEvents: 'none'}}>{
                // file.size === 0 ? 'â€”' : sizeFormat(file.size)
            }</span>
        </div>
    )
}

export default LoadingFile;
